  apiKey: process.env.FIRE_API_KEY,
  authDomain: 'react-webrtc-be08d.firebaseapp.com',
  projectId: 'react-webrtc-be08d',
  storageBucket: 'react-webrtc-be08d.appspot.com',
  messagingSenderId: '720224266375',
  appId: '1:720224266375:web:c3234ea1550175f54db022',
};

const app = initializeApp(firebaseConfig);

export const db = getFirestore();
